                <button onClick={() => setPopup(false)}>OK</button>
            </div>
        </div> :  <div>
      <h1 style={style.mainContainer}>Cab Booking System</h1>
      <div style={style.mainContainer}>

        <BookingForm />
      </div>
    </div>}
